import React, {useContext} from 'react';
import { AlertState } from '../context/alert/AlertState';

export const Search = () => {

    const onSubmit = () => {
        const {} = useContext(AlertState);
    }

    return (
        <div className='form-group'>
            <input
                type="text"
                className="form-control"
                placeholder="Введите никнейм пользователя..."
                onKeyPress={onSubmit}
            >
            </input>
        </div>
    )
}
